Preparación de la solución estándar interna:
Pesar 0,2 g de n-pentadecano en un matraz volumétrico de 500 mL, disolver y diluir hasta la marca con cloroformo y agitar bien.

Preparación de soluciones patrón:
Pesar 0,07 g (con una precisión de 0,0001 g) de muestra estándar de impureza 3 respectivamente en un matraz volumétrico de 10 ml, agregar cloroformo para disolver y diluir hasta la marca, agitar bien. Transfiera 2,0 mL de la solución estándar anterior de la impureza 1 con una pipeta y colóquela en una botella de vidrio de 10 mL con tapón, agregue 5 mL de la solución estándar interna con una pipeta y agite bien.

Preparación de soluciones de muestra:
Pese 1 g (con una precisión de 0,0001 g) de muestra, colóquela en una botella de vidrio de 10 ml con tapón, agregue 5 ml de solución estándar interna con una pipeta, luego agregue 5 ml de cloroformo y agite bien.

Determinación:
Bajo las condiciones de operación anteriores, después de que la línea de base del instrumento sea estable, inyecte la solución de muestra estándar para agujas humanas continuamente y calcule la repetibilidad de la relación del área máxima de cada aguja de la muestra estándar al área máxima de el estándar interno Cuando el cambio relativo en la relación es inferior al 10%,analice y mida en el orden de solución estándar, solución de muestra, solución de muestra y solución estándar.

Condiciones de funcionamiento de la cromatografía de gases:
Temperatura: la temperatura de la columna se mantuvo a 135 °C durante 12 min, se calentó a 180 °C a una velocidad de 40 °C/min durante 6 min y luego se aumentó a 250 °C a una velocidad de 40 °C/min durante 4 min, la cámara de vaporización estaba a 210 °C y el detector a 250 °C;
Flujo de gas, gas portador (nitrógeno) 2,0 ml/min, hidrógeno 30 ml/min, aire 300 ml/min;
Relación de división: 30 : 1;
Volumen de inyección: 1,0 μL;
Tiempo de retención: la impureza 3 es de aproximadamente 17,7 min, el estándar interno es de aproximadamente 6,7 min.
Los parámetros operativos anteriores son típicos, y los parámetros operativos dados se pueden ajustar adecuadamente de acuerdo con las características de diferentes instrumentos, para obtener los mejores resultados.

Calcular:
Las relaciones del área del pico de la impureza 3 al estándar interno en las dos agujas de la solución de muestra y las dos agujas de la solución estándar antes y después de la muestra se promediaron respectivamente. La fracción de masa de la impureza 3 en la muestra se calcula según la fórmula: w2=r4*m3*w/(r3*m4*k)
donde,
r3: el valor promedio de la relación de la impureza 3 al área del pico del estándar interno en la solución estándar;
r4: el valor promedio de la relación de la impureza 3 al área del pico del estándar interno en la solución de muestra;
m3: el valor de la calidad de la muestra patrón, g;
m4: el valor de la masa de la muestra, g;
w: la fracción de masa de impurezas 3 en la muestra estándar, expresada en %;
k: factor de conversión, k=5

Preparación de la solución estándar interna:
Pesar 5,0 g de ftalato de di-n-amilo en un matraz volumétrico de 500 mL, disolver y diluir hasta la marca con cloroformo y agitar bien.

Preparación de soluciones patrón:
Pesar 0,05 g (con una precisión de 0,0001 g) de muestra estándar de esperma de S-metolachloro, colocarla en un frasco de vidrio tapado, agregar 5 ml de solución estándar interna con una pipeta y agitar bien.

Preparación de soluciones de muestra:
Pesar una muestra que contenga 0,05 g de S-metolachloro espermatozoide (precisión de 0,0001 g), colocarla en un frasco de vidrio tapado y agregar 5 mL de solución estándar interna con la misma pipeta y agitado.

Determinación:
Bajo las condiciones de operación anteriores, después de que la línea de base del instrumento sea estable, inyecte la solución de muestra estándar para agujas humanas continuamente y calcule la repetibilidad de la relación del área del pico de cada aguja de S-metolachloro con el estándar interno. el cambio relativo de la relación entre el área del pico de cloramina y el estándar interno es inferior al 1,5%, analice y mida en el orden de solución estándar, solución de muestra, solución de muestra y solución estándar.

Condiciones de funcionamiento de la cromatografía de gases:
Temperatura: temperatura de la columna 220°C, cámara de vaporización 260°C, detector 280°C;
Caudal: gas portador (nitrógeno) 2,0 ml/min, hidrógeno 30 ml/min, aire 300 ml/min;
Relación de división: 30: 1;
Volumen de inyección: 1,0 μL;
Tiempo de retención: aproximadamente 5,5 min para esperma de S-metolachloro y aproximadamente 7,4 min para estándar interno.
Los parámetros operativos anteriores son típicos, y los parámetros operativos dados se pueden ajustar adecuadamente de acuerdo con las características de diferentes instrumentos, para obtener los mejores resultados.

Calcular:
La fracción de masa w1 (%) de S-metolachloro en la muestra se calcula según la fórmula:
w1=r2*m1*w/(r1*m2)
donde,
r1: el valor promedio de la relación entre el área del pico de S-metolachloro y el estándar interno en la solución estándar;
r2: el valor promedio de la relación entre el área del pico de S-metolachloro y el estándar interno en la solución de muestra;
m1: el valor de la calidad de S-metolachloro en la muestra patrón, g;
m2: el valor de la masa de S-metolachloro en la muestra, g;
w: fracción de masa de la muestra estándar de S-metolachloro, expresada en %

