En un matraz aforado de 50 mL, diluir hasta la marca con metanol y agitar bien.

Preparación de soluciones de muestra:
Pese la muestra de fármaco original que contiene 0,1 g de piraclostrobina (con una precisión de 0,0001 g) en un matraz volumétrico de 50 ml, agregue aproximadamente 30 ml de metanol, agite ultrasónicamente durante 5 minutos para disolver, enfríe a temperatura ambiente y diluya con metanol para marcar. agitar bien. Pipetee 5 ml de la solución anterior en un matraz volumétrico de 50 ml, diluya hasta la marca con metanol y agite bien.

Determinación:
En las condiciones de funcionamiento anteriores, una vez que el instrumento esté estable, inyecte varias agujas de solución estándar de forma continua hasta que el cambio relativo del área del pico de dos agujas adyacentes de piraclostrobina sea inferior al 1,2 % , analice y mida en el orden de solución estándar, solución de muestra, solución de muestra y solución estándar.

Condiciones de funcionamiento de la cromatografía líquida:
Fase móvil: ψ4 (metanol: agua: ácido acético glacial) = 80: 20: 0,1, filtrada a través de una membrana filtrante y desgasificada;
Caudal: 1,0 ml/min;
Temperatura de la columna: temperatura ambiente (el cambio en la diferencia de temperatura no debe ser superior a 2°C);
Longitud de onda de detección: 275 nm;
Volumen de inyección: 5 μL;
Tiempo de retención: piraclostrobina alrededor de 11,7 min.
Los parámetros operativos anteriores son típicos, y los parámetros operativos dados se pueden ajustar adecuadamente de acuerdo con las características de diferentes instrumentos, para obtener los mejores resultados.

