Las áreas de los picos medidos de piraclostrobina en las dos agujas de la solución de muestra y las dos agujas de la solución estándar antes y después de la muestra se promediaron respectivamente. La fracción de masa de piraclostrobina en la muestra se calcula según la fórmula: w1=A2*m1*w/(A1*m2)
donde,
A1: El valor promedio de la relación de las áreas de los picos de piraclostrobina y el estándar interno en la solución estándar;
A2: el valor promedio de la relación de las áreas de los picos de piraclostrobina al estándar interno en la solución de muestra;
m1: el valor de la calidad de la muestra patrón, g;
m2: el valor de la masa de la muestra, g;
w: la fracción de masa de piraclostrobina en la muestra estándar, expresada en %;

