Método de determinación de plaguicidas técnicos:
Tome una pequeña cantidad de muestra y disuélvala en etanol (si el etanol no es fácil de disolver, disuélvalo en una solución de acetona al 90 % o al 95 %), agregue de 3 a 5 gotas de indicador rojo de metilo (o indicador mixto) para identificación, si la solución se vuelve roja, es solución ácida, mida la acidez; si es amarilla (el indicador mixto es verde), es una solución alcalina, y mida la alcalinidad.
Pesar la muestra (con una precisión de 0,002 g), colocarla en un matraz cónico de 250 mL, agregar 50 mL de etanol al 95 % (o acetona), agitar para disolver la muestra, agregar de 3 a 5 gotas de indicador rojo de metilo (o indicador mixto ) inmediatamente después de la titulación con una solución de titulación estándar.
La determinación de la acidez, la titulación con una solución de titulación estándar de hidruro de hidrógeno y sodio de 0,02 mol/l hasta amarillo (el indicador mixto es verde) es el punto final. La determinación de la alcalinidad, la titulación con solución de titulación estándar de ácido clorhídrico de 0,02 mol/L a rojo es el punto final.
Al mismo tiempo, realice la medición en blanco, tome 50 mL del mismo solvente que la muestra de prueba y colóquelo en un matraz cónico de 250 mL para la titulación con solución de titulación estándar de hidróxido de sodio de 0,02 mol/L.

Método de determinación de la preparación de plaguicidas:
Tome una pequeña cantidad de muestra y disuélvala en etanol (si el etanol no es fácil de disolver, disuélvalo en acetona), agregue de 3 a 5 gotas de indicador rojo de metilo (o indicador mixto) para identificación, si se vuelve rojo, es una solución ácida, y se mide la acidez; si se vuelve amarilla (indicador mixto) El agente es verde) es una solución alcalina, y se mide la alcalinidad.
Pesar de 2 a 5 g de muestra (con una precisión de 0,002 g), colocarla en un matraz cónico de 250 ml, agregar 50 ml de etanol al 95 % (o acetona), agitar para disolver la muestra (si es necesario, se puede disolver en un baño de agua ultrasónico). Se agregaron de 3 a 5 gotas de indicador rojo de metilo (o indicador mixto) y se tituló inmediatamente con solución estándar de titulación.
La determinación de la acidez, la titulación con una solución de titulación estándar de hidróxido de sodio de 0,02 mol/L a amarillo (el indicador mixto es verde) es el punto final.
La alcalinidad, la titulación con solución de titulación estándar de ácido clorhídrico de 0,02 mol/L a rojo es el punto final.
Al mismo tiempo, realice la medición en blanco, tome 50 mL del mismo solvente que la muestra de prueba y colóquelo en un matraz cónico de 250 mL para la titulación con solución de titulación estándar de hidróxido de sodio de 0,02 mol/L.

Calcular:
La acidez w (%) de la muestra se calcula según la fórmula: w=c * (V1 - V0) *M / (m*1000) x 100
donde,
c: concentración real de solución estándar de titulación de hidróxido de sodio, mol/L;
V1: titular la solución de muestra, consumir el volumen de la solución estándar de titulación de hidróxido de sodio, mL;
V0: solución de titulación en blanco, el volumen de solución de titulación estándar de hidróxido de sodio consumido, mL;
m: la masa de la muestra, en gramos (g);
M: Valor numérico de la masa molar del ácido sulfúrico, g/mol, M(1/2H2SO4)=49.

La alcalinidad w’ (%) de la muestra se calcula según la fórmula: w'= (V2*c + V0*c)*M2 / (m * 1000) x 100
donde,
c: concentración real de solución estándar de titulación de hidróxido de sodio, mol/L;
c1: Concentración real de la solución estándar de titulación de ácido clorhídrico, mol/L;
V2: solución de muestra de titulación, el volumen de solución de titulación estándar de ácido clorhídrico consumido, mL;
V0: - Titular la solución blanco, consumir el volumen de solución estándar de titulación de hidróxido de sodio, mL;
m: la masa de la muestra, en gramos (g);
M2: valor numérico de la masa molar del hidróxido de sodio, g/mol, [M2(NaOH)=40,01]

