Fostiazato TC
Preparación de soluciones estándar:
Pesar 0,1 g (con una precisión de 0,0001 g) de muestra estándar de fostiazato en un matraz aforado de 50 ml, disolver y diluir hasta la marca con fase móvil y agitar bien. Pipetee 5 ml de la solución anterior en un matraz volumétrico de 50 ml, diluya hasta la marca con fase móvil y agite bien.

Preparación de soluciones de muestra:
Pesar el fármaco técnico de tiazofosfina que contiene 0,1 g de fostiazato (con una precisión de 0,0001 g) en un matraz aforado de 50 ml, disolver y diluir hasta la marca con fase móvil y distribuir uniformemente. Pipetee 5 ml de la solución anterior en un matraz volumétrico de 50 ml, diluya hasta la marca con fase móvil y agite bien.

Determinación
En las condiciones de funcionamiento anteriores, después de estabilizar el instrumento, inyecte la solución de muestra estándar para agujas humanas de forma continua hasta que el cambio relativo del área del pico de dos agujas adyacentes de fostiazato sea inferior al 1,2 %; analice y mida en el orden de solución estándar, solución de muestra, solución de muestra y solución estándar.

Condiciones de funcionamiento de la cromatografía líquida:
Fase móvil: ψ (metanol: agua) = 70:30, filtrada a través de una membrana filtrante y desgasificada;
