Temperatura de la columna: temperatura ambiente (el cambio en la diferencia de temperatura no debe ser superior a 2°C);
Longitud de onda de detección: 220 nm;
Volumen de inyección: 5μL;
Tiempo de retención: la fostiazato es de unos 5,2 min.
