La fracción de masa w1 (%) de fostiazato en la muestra se calcula según la fórmula:
w1=A2*m1*w/(A1*m2)
A1: El valor promedio del área del pico de fostiazato en la solución estándar;
A2: El valor promedio del área del pico de fostiazato en la solución de muestra;
